import React, { useEffect, useState } from "react";
import SignleReport from './SingleReport';

function ReportDashboard() {
    const [reps, setReps] = useState([{
        id: '',
        state: '',
        type: '',
        message: ''
    }])

    useEffect(() => {
        fetch("/reportdashboard")
            .then(res => {
                return res.json()

            }).then(jsonRes =>
                setReps(jsonRes));

    })

    return <div className="container">
        <h2>Report Dashboard</h2>
        
        {reps.map(rep =>
            <SignleReport key={reps.id} state={rep.state} type={rep.type} message={rep.message} reps={reps} setReps={setReps} />
        )}
    </div>
}

export default ReportDashboard;
